import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Function to generate time slots with 45-minute intervals
  const generateTimeSlots = () => {
    const startTime = 9 * 60; // 9:00 AM in minutes
    const endTime = 17 * 60 + 15; // 5:15 PM in minutes
    const interval = 45; // 45 minutes interval
    const timeSlots = [];

    for (let i = startTime; i <= endTime; i += interval) {
      const hours = Math.floor(i / 60);
      const minutes = i % 60;
      const formattedTime = `${hours < 10 ? '0' : ''}${hours}:${minutes === 0 ? '00' : minutes}`;
      timeSlots.push(formattedTime);
    }

    return timeSlots;
  };

  // Dummy schedule data (replace with your actual data source)
  const dummySchedule = {
    "slots": [
      [2024, 4, 5, 11, 15],
      [2024, 4, 6, 15, 45],
      [2024, 4, 7, 15, 0],
      [2024, 4, 6, 15, 45],
      [2024, 4, 5, 15, 0]
    ],
    "appointments": [
      { id: 1, datetime: [2024,4,5,9,0], patientName: 'John Doe', meetingLink: 'some-meeting-link' },
      { id: 2, datetime: [2024,4,6,10,30], patientName: 'somebody someone', meetingLink: 'another-meeting-link' },
      { id: 3, datetime: [2024,4,7,11,15], patientName: 'Alice Smith', meetingLink: 'third-meeting-link' },
      { id: 5, datetime: [2024,4,6,9,0], patientName: 'John Doe', meetingLink: 'fourth-meeting-link' },
    ]
  };

  const initialSchedule = () => {
    const today = new Date();
    const next7Days = Array.from({ length: 7 }, (_, index) => {
      const date = new Date(today);
      date.setDate(date.getDate() + index);
      return date.toLocaleDateString('en-US');
    });

    const timeSlots = generateTimeSlots();

    const schedule = next7Days.reduce((acc, date) => {
      acc[date] = timeSlots.reduce((acc2, time) => {
        acc2[time] = false; // All slots initially unavailable
        return acc2;
      }, {});
      return acc;
    }, {});

    dummySchedule.slots.forEach(slot => {
      const [year, month, day, hour, minute] = slot;
      const date = new Date(year, month - 1, day);
      const formattedDate = date.toLocaleDateString('en-US');
      const formattedTime = `${hour < 10 ? '0' : ''}${hour}:${minute === 0 ? '00' : minute}`;
      if (schedule[formattedDate] && schedule[formattedDate][formattedTime] !== undefined) {
        schedule[formattedDate][formattedTime] = true; // Set slot to available
      }
    });

    dummySchedule.appointments.forEach(appointment => {
      const [year, month, day, hour, minute] = appointment.datetime;
      const date = new Date(year, month - 1, day);
      const formattedDate = date.toLocaleDateString('en-US');
      const formattedTime = `${hour < 10 ? '0' : ''}${hour}:${minute === 0 ? '00' : minute}`;
      if (schedule[formattedDate] && schedule[formattedDate][formattedTime] !== undefined) {
        schedule[formattedDate][formattedTime] = appointment; // Set appointment object
      }
    });

    return schedule;
  };

  // State for schedule data
  const [schedule, setSchedule] = useState(initialSchedule());

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  // State for selected appointment
  const [selectedAppointment, setSelectedAppointment] = useState(null);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability or show warning for appointment)
  const handleCellClick = (date, time) => {
    if (isEditing) {
      if (schedule[date][time] === 'appointment') {
        const confirmed = window.confirm('You are about to cancel an appointment. Are you sure?');
        if (confirmed) {
          setSchedule((prevSchedule) => ({
            ...prevSchedule,
            [date]: {
              ...prevSchedule[date],
              [time]: false,
            },
          }));
        }
      } else {
        setSchedule((prevSchedule) => ({
          ...prevSchedule,
          [date]: {
            ...prevSchedule[date],
            [time]: !prevSchedule[date][time],
          },
        }));
      }
    } else {
      if (schedule[date][time] !== false) {
        setSelectedAppointment(schedule[date][time]);
      }
    }
  };

  // Function to close modal
  const handleCloseModal = () => {
    setSelectedAppointment(null);
  };

  // Function to join meeting
  const handleJoinMeeting = () => {
    if (selectedAppointment && selectedAppointment.meetingLink) {
      window.open(selectedAppointment.meetingLink, '_blank');
    }
  };

  // Function to view patient details
  const handleViewPatientDetails = () => {
    // Implement logic to view patient details
    // For example, navigate to patient details page
  };

  // Function to cancel appointment
  const handleCancelAppointment = () => {
    if (selectedAppointment) {
      const confirmed = window.confirm('Are you sure you want to cancel this appointment?');
      if (confirmed) {
        // Implement logic to cancel appointment
        // For example, send API request to cancel appointment
        setSchedule((prevSchedule) => ({
          ...prevSchedule,
          [selectedAppointment.date]: {
            ...prevSchedule[selectedAppointment.date],
            [selectedAppointment.time]: false,
          },
        }));
        setSelectedAppointment(null);
      }
    }
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className= 'dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box">
            <thead>
              <tr>
                <th></th>
                {generateTimeSlots().map(time => (
                  <th key={time}>{time}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {Object.entries(schedule).map(([date, timeslots]) => (
                <tr key={date}>
                  <th scope="row">{date}</th>
                  {Object.entries(timeslots).map(([time, appointment]) => (
                    <td
                      key={`${date}-${time}`}
                      className={
                        appointment === true ? 'table-success bg-success text-white' :
                        appointment === 'appointment' ? 'table-danger' :
                        'table-secondary'
                      }
                      onClick={() => handleCellClick(date, time)}
                    >
                      {isEditing ? '' : appointment ? `${appointment.patientName}` : time}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing ? (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          ) : (
            <button type="button" className="btn btn-success custom-button2" onClick={handleUpload}>
              Upload New Schedule
            </button>)}
        </div>
      </div>
      {selectedAppointment && (
        <div className="modal fade show" style={{ display: 'block' }} tabIndex="-1" role="dialog">
          <div className="modal-dialog modal-sm custom-box">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Appointment Details - {selectedAppointment.date}</h5>
                <button type="button" className="close" onClick={handleCloseModal}>
                  <span aria-hidden="true">&times;</span>
                </button>
              </div>
              <div className="modal-body">
                <p>Date: {selectedAppointment.date}</p>
                <p>Time: {selectedAppointment.time}</p>
                <p>Patient: {selectedAppointment.patientName}</p>
              </div>
              <div className="modal-footer">
                <button type="button" className="btn btn-success custom-button2" onClick={handleJoinMeeting}>
                  Join Meeting
                </button>
                <button type="button" className="btn btn-info custom-button2" onClick={handleViewPatientDetails}>
                  View Patient
                </button>
                <button type="button" className="btn btn-danger" onClick={handleCancelAppointment}>
                  Cancel Appointment
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
